PRAGMA encoding = "UTF-8";
PRAGMA journal_mode = OFF;
PRAGMA locking_mode = EXCLUSIVE;

CREATE TABLE points_of_interest (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  lat REAL,
  lng REAL,
  title VARCHAR(255),
  address VARCHAR(255),
  city VARCHAR(255),
  flag INTEGER
);

CREATE INDEX points_of_interest_lat_index ON points_of_interest(lat);
CREATE INDEX points_of_interest_lng_index ON points_of_interest(lng);

